def coords(pointAndName: (String, String)): (Double, Double) = {
    def parseDouble(s: String): Double = try { s.toDouble } catch { case _: Throwable => 0.0 }
    val str = pointAndName._1
    val coords = str.dropWhile(x => x.compareTo('(') != 0).drop(1).dropRight(1).split(" ").map(_.trim) // Convert 'POINT(x,y)' to Array[Double]
    (parseDouble(coords(0)), parseDouble(coords(1)))
}
